import React, { useState } from "react";
import axios from "axios";

// Import CSS files
import "./css/styles-merged.css";
import "../css/style.min.css";
import "../css/style.css";
import "./css/predictor.css";
import "./css/back-to-top.css";
import "./D:/css/default-skin/default-skin.css";

const UploadPage = () => {
  // Your state and functions (if any)
  const [uploadedImage, setUploadedImage] = useState(null);

  const handleImageChange = (event) => {
    const file = event.target.files[0];
    if (file) {
      const reader = new FileReader();
      reader.onload = (e) => {
        setUploadedImage(e.target.result);
      };
      reader.readAsDataURL(file);
    }
  };

  const handleSubmit = async (event) => {
    event.preventDefault();
    try {
      // Perform image upload logic here (example with Axios)
      const formData = new FormData();
      formData.append("image", uploadedImage);

      const response = await axios.post("/upload", formData, {
        headers: {
          "Content-Type": "multipart/form-data",
        },
      });
      console.log("Image uploaded successfully:", response.data);
    } catch (error) {
      console.error("Error uploading image:", error);
    }
  };

  return (
    <>
      <nav className="navbar navbar-default probootstrap-navbar">
        <div className="container">
          <div className="navbar-header">
            <button
              className="navbar-toggle collapsed"
              type="button"
              data-toggle="collapse"
              data-target="#navbar-collapse"
              aria-expanded="false"
              aria-controls="navbar"
            >
              <span className="sr-only">Toggle navigation</span>
              <span className="icon-bar" />
              <span className="icon-bar" />
              <span className="icon-bar" />
            </button>
            <a className="navbar-brand" href="UploadPage.js">
              Cattle Disease Analysis & Prediction
            </a>
          </div>
          <div className="collapse navbar-collapse" id="navbar-collapse">
            <ul className="nav navbar-nav navbar-right">
              <li className="active">
                <a href="#home">Home</a>
              </li>
              <li>
                <a href="#features">About Us</a>
              </li>
              <li>
                <a href="#predict">Predict</a>
              </li>
              <li>
                <a href="#analysis">Preventive Measures</a>
              </li>
              <li>
                <a href="#contact">Feedback</a>
              </li>
            </ul>
          </div>
        </div>
      </nav>

      <section
        id="home"
        className="probootstrap-hero probootstrap-slant"
        style={{
          backgroundImage:
            "url(https://www.grandmasterglobal.com/blog/wp-content/uploads/2024/03/ai-cowbreeding-1000x560.jpeg)",
        }}
      >
        <div className="container">
          <div className="row intro-text">
            <div className="col-md-8 col-md-offset-2 text-center">
              <h1 className="probootstrap-heading">
                Early detection saves lives – and livelihoods
              </h1>
              <p className="probootstrap-subheading">
                <a className="btn btn-primary" href="#predict">
                  Check Now
                </a>
                <a className="btn btn-default smoothscroll" href="#analysis">
                  See Analysis
                </a>
              </p>
            </div>
          </div>
        </div>
      </section>

      <section id="features" className="probootstrap-section probootstrap-bg-light">
        <div className="container">
          <div className="row text-center mb100">
            <div className="col-md-8 col-md-offset-2">
              <h2>About Us</h2>
              <p>
                We are dedicated to revolutionizing livestock health management
                through cutting-edge technology...
              </p>
            </div>
          </div>
        </div>
      </section>

      <section id="predict" className="probootstrap-section">
        <div className="container">
          <div className="row text-center mb100">
            <div className="col-md-8 col-md-offset-2">
              <h2>Predict the Disease</h2>
              <p>Provide the proper image.</p>
            </div>
          </div>
          <div className="row">
            <div className="col-md-6 col-md-offset-3">
              <form onSubmit={handleSubmit}>
                <input type="file" onChange={handleImageChange} accept="image/*" />
                {uploadedImage && (
                  <div style={{ marginTop: 20 }}>
                    <img
                      src={uploadedImage}
                      alt="Uploaded"
                      style={{ maxWidth: "100%" }}
                    />
                  </div>
                )}
                <button type="submit" className="btn btn-primary" style={{ marginTop: 20 }}>
                  Process Image
                </button>
              </form>
            </div>
          </div>
        </div>
      </section>
    </>
  );
};

export default UploadPage;
